import React from 'react';
import './HotelsSection.css';

const HotelsSection = () => {
    const hotels = [
        { name: "Serena Hotel", description: "Luxury hotel in the heart of Islamabad." },
        { name: "Marriott Islamabad", description: "5-star hotel with premium amenities." },
        { name: "Pearl Continental", description: "Elegant hotel offering great views." },
    ];

    return (
        <section className="hotels-section">
            <h3>Recommended Hotels</h3>
            <div className="hotels-list">
                {hotels.map((hotel, index) => (
                    <div key={index} className="hotel-card">
                        <h4>{hotel.name}</h4>
                        <p>{hotel.description}</p>
                    </div>
                ))}
            </div>
        </section>
    );
};

export default HotelsSection;
